import ExpenseItem from "./ExpenseItem";
import Card from "../UI/Card";
import ExpensesFilter from "./ExpenseFilter";
import './Expense.css';

const Expense = (props) => {
  const expense = props.expenses.map((item) =>
    <ExpenseItem
      title={item.title}
      amount={item.amount}
      date={item.date}
    />
  );

  return (
    <Card className="expenses">
      <ExpensesFilter />
      {expense}
    </Card>
  );
}

export default Expense;
